import React from "react";
import Header from "../component/Header";
import List from "../component/List";
import AddForm from "../component/AddForm/AddForm";
import styled from "styled-components";

const StBox = styled.div`
  color: #372e2e;
  max-width: 1200px;
  min-width: 800px;
  margin: auto;
`;

const Home = () => {
  return (
    <StBox>
      <Header />
      <AddForm />
      <List />
    </StBox>
  );
};

export default Home;
